.title[
# Decomposing temporal changes of biodiversity to loss, survival, and recruitment of individuals: analysis of the North-American avifauna
]
.author[
### <br>FranÃ§ois Leroy<br>Marta Jarzyna<br>Petr Keil
]

]

---




# Biodiversity

* Multi-faceted (species richness, turnover, abundance)

* Changes through time

* Perturbed (mostly) by human activities

--

&lt;br&gt;

.center[
## Abundance
]

* the best metric to follow biodiversity state 

* overall decline of 69% (*acc.* Living Planet Index)

.center[
`\(\Rightarrow\)` Marine Sharks and Rays: -71%&lt;br&gt;&lt;br&gt;
`\(\Rightarrow\)` Freshwater: -83%&lt;br&gt;&lt;br&gt;
`\(\Rightarrow\)` -3 billion North-American birds since 70&#39;s
]

---

# Decomposing abundance change

* Temporal change of abundance ( `\(\Delta N\)` ) results of `\(3\)` processes

&lt;br&gt;

.center[
&lt;img src=&quot;data:image/png;base64,#images/deltaN_concept1.png&quot; width=&quot;100%&quot; /&gt;
]
&lt;br&gt;
`$$\Rightarrow \Delta N = N_{t1} - N_{t0} = R - L$$`

---

# Decomposing growth rate

* Growth rate: per individual average change

.center[
&lt;img src=&quot;data:image/png;base64,#images/deltaN_concept2.png&quot; width=&quot;100%&quot; /&gt;
]

.pull-left[

* Loss rate = individual probability of dying/emigrating

* Loss rate `\(= \frac{L}{N_{t0}}\)`

]

.pull-right[

* Recruitment rate = individual probability of producing an individual 

* Recruitment rate `\(= \frac{R}{N_{t0}}\)`

]

--

.center[

`\(\Rightarrow\)` Growth rate = `\(\frac{\Delta N}{N_{t0}} = \frac{R}{N_{t0}} - \frac{L}{N_{t0}}\)`

]

---

class: inverse, center, middle

## Problem

Assessing the ongoing decrease of abundance does not tell us which process is driving the trend

--

### Increase in recruitment?
Better reproductive success, better breeding habitat...

--

#### Or

### Decrease of individual loss?
Reduction of threats, better habitat quality...

---
